function: "Fully working printable M8 hex nuts with standard dimensions. They are derived from the wonderful ISO Metric thread library by Trevor Moseley.\r\n\r\nDo you want to build a Prusa with printable nuts and washers? Just download them and do it!\r\n\r\nYou can see these parts in action in this video: \r\nhttp://www.youtube.com/watch?v=xHMjs-O9nq0\r\n\r\nMore information (In Spanish):\r\nhttp://www.iearobotics.com/wiki/index.php?title=Tuerca_M8_imprimible\r\n\r\nUPDATE: 2012/Sep/06\r\nhttp://www.youtube.com/watch?v=EIm0ZwCNhyA\r\n\r\nThe printable nuts are not only functional and cool. They can also be taken off very easily from the heatbed using a Wrench!! :-D"
